import { MaterialIcons } from "@expo/vector-icons";
import React from "react";
import { Text,View } from "react-native";
import { TouchableOpacity } from "react-native-gesture-handler";

const AddToChatScreen=()=>{
    return(
        <View>
          <View style={{width:'100%',backgroundColor: '	#36802d',   paddingTop: 24, 
    paddingBottom: 104, 
    paddingLeft: 16, 
    paddingRight: 16, 
    flex: 0.55,}}></View>
    <View style={{flexDirection:'row',alignItems:'center',justifyContent:'space-between',paddingTop:24,paddingBottom:24,paddingLeft:12,paddingRight:12}}>
    <TouchableOpacity onPress={()=>Navigation.goBack()}>
    <MaterialIcons name="chevron-left" size={32} color={'#fbfbfb'}/>
    </TouchableOpacity>
    </View>
        </View>
    )
}
export default AddToChatScreen
